script: |
  super -f text -I q9620.spq | sort > q9620.out

inputs:
  - name: q9620.spq
    data: |
      SELECT - + col1 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE NOT ( + - CAST ( NULL AS REAL ) * + 64 + - - 62 NOT BETWEEN col0 + - col0 AND NULL );
  - name: tab1

outputs:
  - name: q9620.out
    data: |
